import './App.css';
import NavBar from './Components/NavBar';

function App() {
  return (
    <div className="App">
      <div className='home'>
        <div className='home-container'>
          <NavBar />
          <div className='container-hero'>
            <div className='hero'>
              <div className='hero-text'>
                <h1>hello</h1>
              </div>
            </div>
          </div>

        </div>
      </div>
    </div>
  );
}

export default App;
